from sage.all import *
from Crypto.Util.number import *

def factorize(N, e, d):
    Zn = Zmod(N)
    k = e*d - 1
    while True:
        g = Zn.random_element()
        while k % 2 == 0:
            k //= 2
            x = g**(k)
            if x != 1 and gcd(x-1, N) != 1:
                p=ZZ(gcd(x-1, N))
                return p, N // p


